import React from "react";
import  { createContext } from "react";

const FirstName = createContext();
const ComA = () => {
    return(
        <>
        <FirstName.Provider value={"yash"}>
            <ComA/>
        </FirstName.Provider>
        </>

    );
};
export default ComA;
